    false,nt"url": null,nt"notes": "Bats are an integral and significant part
    of the mammalian fauna of Iowa  (Bowles 1975, Clark et al. 1987). In particular,
    the nine species of bats in Iowa are consume significant numbers of insects, ranging
    from small mosquitoes to fairly large moths and beetles. The primary purposes of
    this study were: 1) continue the bat survey as part of the general baseline inventory
    of the Walnut Creek biota begun in 1991 and 2) locate roost trees used by the federally
    endangered Indiana bat, Myotis sodalis.",nt"license_title": "License Not Specified",nt"extras":
